import '../styles/style.css';
import {useState} from "react";

const Form = () => {
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [address, setAddress] = useState('');
    const [zipCode, setZipCode] = useState('');
    const [city, setCity] = useState('');
    const [phoneNumber, setPhoneNumber] = useState('');
    const [email, setEmail] = useState('');
    const [springCleaning, setSpringCleaning] = useState(false);
    const [fallCleaning, setFallCleaning] = useState(false);

    const handleFirstName = (e) => {
        const value = e.target.value;
        setFirstName(value);
        console.log(firstName);
    }

    const handleLastName = (e) => {
        setLastName(e.target.value);
        console.log(lastName);
    }

    const handleAddress = (e) => {
        setAddress(e.target.value);
        console.log(address);
    }

    const handleZipCode = (e) => {
        setZipCode(e.target.value);
        console.log(zipCode);
    }

    const handleCity = (e) => {
        setCity(e.target.value);
        console.log(city);
    }

    const handlePhoneNumber = (e) => {
        setPhoneNumber(e.target.value);
        console.log(phoneNumber);
    }

    const handleEmail = (e) => {
        setEmail(e.target.value);
        console.log(email);
    }

    const handleSpringCleaning = (e) => {
        setSpringCleaning(e.target.value);
        if (springCleaning === false) {
            setSpringCleaning(true);
            console.log(springCleaning);

        }
    }

    const handleFallCleaning = (e) => {
        setFallCleaning(e.target.value);
        setFallCleaning(true);
        console.log(fallCleaning);
    }

    const handleSubmit = () => {

    }

    return (
        <div className='form-container'>
            <form className='form' onSubmit={handleSubmit}>
                <label>First name: </label>
                <input value={firstName} type={"text"} onChange={(e) => handleFirstName(e)}/>
                <label>Last name: </label>
                <input value={lastName} type={"text"} onChange={(e) => handleLastName(e)}/>
                <label>Address: </label>
                <input value={address} type={"text"} onChange={(e) => handleAddress(e)}/>
                <label>Zip code: </label>
                <input value={zipCode} type={"text"} onChange={(e) => handleZipCode(e)}/>
                <label>City: </label>
                <input value={city} type={"text"} onChange={(e) => handleCity(e)}/>
                <label>Phone number: </label>
                <input value={phoneNumber} type={"text"} onChange={(e) => handlePhoneNumber(e)}/>
                <label>Email address: </label>
                <input value={email} type={"text"} onChange={(e) => handleEmail(e)}/>
                <label>Spring cleaning: </label>
                <input value={'springCleaning'} type={"radio"} checked={springCleaning === true} onChange={(e) => handleSpringCleaning(e)}/>
                <label>Fall cleaning: </label>
                <input value={'fallCleaning'} type={"radio"} checked={fallCleaning === true} onChange={(e) => handleFallCleaning(e)}/>
            </form>
        </div>
    );
}

export default Form;
